tests.code:
cy.visit("https://www.automationteststore.com/");
cy.get(".thumbnail").as("productThumbnail");
let sum = 0;
// product not in sale only have .oneprice  class
cy.get("@productThumbnail").find(".oneprice").invoke('text').as('prodprices');
cy.get('@prodprices').then(items => {
  const prices = items.split('$');
  let nonsaleprices = 0;
  prices.forEach(i => {
    nonsaleprices += +i;
  });
  sum += nonsaleprices;
  cy.log("Non SALE prods sum is :" + nonsaleprices);
});
// product on sale have .pricenew class
cy.get("@productThumbnail").find(".pricenew").invoke('text').as('saleprodprices');
cy.get('@saleprodprices').then(items => {
  const prices = items.split('$');
  let saleprices = 0;
  prices.forEach(i => {
    saleprices += +i;
  });
  sum += saleprices;
  cy.log("SALE prods sum is :" + saleprices);
  cy.log("total sum : " + sum);
});

cy.visit("https://www.automationteststore.com/");
cy.get(".categorymenu a[href*='category&path=']").contains("Hair Care").click();
cy.get(".fixed_wrapper .prdocutname").each(($el, $index, $list) => {
  if ($el.text().includes("Curls to straight Shampoo")) {
    cy.wrap($el).click();
  }
});

//cy.visit("http://www.webdriveruniversity.com/Contact-Us/contactus.html");
cy.visit("http://www.webdriveruniversity.com");
cy.get('#contact-us').invoke('removeAttr', 'target').click({
  force: true
});
cy.url().should('include', 'contactus');
cy.go('back');
cy.reload();
cy.url().should('include', 'http://www.webdriveruniversity.com/');
//cy.reload(true) //reload without using cache
cy.go('forward');
cy.url().should('include', 'contactus');
cy.go('back');
cy.get('#login-portal').invoke('removeAttr', 'target').click({
  force: true
});
cy.url().should('include', 'Login-Portal');
cy.go('back');
cy.get('#to-do-list').invoke('removeAttr', 'target').click({
  force: true
});
cy.url().should('include', 'To-Do-List');
cy.go('back');

// pass aray of check box values that you want to check or pass one value without array if you  want to check one of them
cy.get("#checkboxes input[type='checkbox']").check(["option-1", "option-2", "option-3", "option-4"]).should('be.checked');
;

